	SUPER^.SetData(CanMsgPointer);
	//Set the new data
	u16gEngine_Use_Time.Value := canMsgPointer^.GetUint16(0);
	u16gEngine_RPM.Value := canMsgPointer^.GetUint16(16);
	u16gVehiculeSpeed.Value := canMsgPointer^.GetUint16(32);
	u8gLateralizationStop.Value := canMsgPointer^.GetUint8(48);
	u8gKeySelector.Value := canMsgPointer^.GetUint8(56);
	//And increase the counter
	Counter.Value := CanMsgPointer^.Counter.Value;
