IF u16gEngine_Use_Time.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u16gEngine_Use_TimeRawValue", "Division by Zero!");
	RETURN;
End_IF

u16gEngine_Use_TimeRawValue := TO_UINT((u16gEngine_Use_Time.Value - u16gEngine_Use_Time.AppScalingOffset) * u16gEngine_Use_Time.AppScalingDivisor / u16gEngine_Use_Time.AppScalingMultiplier);

IF u16gEngine_RPM.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u16gEngine_RPMRawValue", "Division by Zero!");
	RETURN;
End_IF

