IF u16FaultyValue.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u16FaultyValueRawValue", "Division by Zero!");
	RETURN;
End_IF

u16FaultyValueRawValue := TO_UINT((u16FaultyValue.Value - u16FaultyValue.AppScalingOffset) * u16FaultyValue.AppScalingDivisor / u16FaultyValue.AppScalingMultiplier);

IF u8DeviceNum.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8DeviceNumRawValue", "Division by Zero!");
	RETURN;
End_IF

u8DeviceNumRawValue := TO_USINT((u8DeviceNum.Value - u8DeviceNum.AppScalingOffset) * u8DeviceNum.AppScalingDivisor / u8DeviceNum.AppScalingMultiplier);

IF u8ErrorCode.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8ErrorCodeRawValue", "Division by Zero!");
	RETURN;
End_IF

u8ErrorCodeRawValue := TO_USINT((u8ErrorCode.Value - u8ErrorCode.AppScalingOffset) * u8ErrorCode.AppScalingDivisor / u8ErrorCode.AppScalingMultiplier);

IF u16FaultyValue.ToolScalingDivisor = 0 OR u16FaultyValue.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u16FaultyValueToolValue", "Division by Zero!");
	RETURN;
END_IF

u16FaultyValueToolValue := TO_UINT(((u16FaultyValue.Value - u16FaultyValue.AppScalingOffset) * u16FaultyValue.AppScalingDivisor / u16FaultyValue.AppScalingMultiplier * u16FaultyValue.ToolScalingMultiplier / u16FaultyValue.ToolScalingDivisor) + u16FaultyValue.ToolScalingOffset);

IF u8DeviceNum.ToolScalingDivisor = 0 OR u8DeviceNum.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8DeviceNumToolValue", "Division by Zero!");
	RETURN;
END_IF

u8DeviceNumToolValue := TO_USINT(((u8DeviceNum.Value - u8DeviceNum.AppScalingOffset) * u8DeviceNum.AppScalingDivisor / u8DeviceNum.AppScalingMultiplier * u8DeviceNum.ToolScalingMultiplier / u8DeviceNum.ToolScalingDivisor) + u8DeviceNum.ToolScalingOffset);

IF u8ErrorCode.ToolScalingDivisor = 0 OR u8ErrorCode.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8ErrorCodeToolValue", "Division by Zero!");
	RETURN;
END_IF

u8ErrorCodeToolValue := TO_USINT(((u8ErrorCode.Value - u8ErrorCode.AppScalingOffset) * u8ErrorCode.AppScalingDivisor / u8ErrorCode.AppScalingMultiplier * u8ErrorCode.ToolScalingMultiplier / u8ErrorCode.ToolScalingDivisor) + u8ErrorCode.ToolScalingOffset);

