IF IsValidPointer(canMsgPointer,'SetData') THEN
	SUPER^.SetData(CanMsgPointer);
	//Set the new data
	u8gFuel.Value := canMsgPointer^.GetUint8(0);
	u16gBattery_Voltage.Value := canMsgPointer^.GetUint16(8);
	u8gTrainTransmissionPressure.Value := canMsgPointer^.GetUint8(24);
	i16gBypassPressureSensorValue.Value := canMsgPointer^.GetInt16(32);
	//And increase the counter
	Counter.Value := CanMsgPointer^.Counter.Value;
END_IF

IF u8gFuel.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8gFuelRawValue", "Division by Zero!");
	RETURN;
End_IF

u8gFuelRawValue := TO_USINT((u8gFuel.Value - u8gFuel.AppScalingOffset) * u8gFuel.AppScalingDivisor / u8gFuel.AppScalingMultiplier);

IF u16gBattery_Voltage.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u16gBattery_VoltageRawValue", "Division by Zero!");
	RETURN;
End_IF

u16gBattery_VoltageRawValue := TO_UINT((u16gBattery_Voltage.Value - u16gBattery_Voltage.AppScalingOffset) * u16gBattery_Voltage.AppScalingDivisor / u16gBattery_Voltage.AppScalingMultiplier);

IF u8gTrainTransmissionPressure.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8gTrainTransmissionPressureRawValue", "Division by Zero!");
	RETURN;
End_IF

u8gTrainTransmissionPressureRawValue := TO_USINT((u8gTrainTransmissionPressure.Value - u8gTrainTransmissionPressure.AppScalingOffset) * u8gTrainTransmissionPressure.AppScalingDivisor / u8gTrainTransmissionPressure.AppScalingMultiplier);

IF i16gBypassPressureSensorValue.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get i16gBypassPressureSensorValueRawValue", "Division by Zero!");
	RETURN;
End_IF

i16gBypassPressureSensorValueRawValue := TO_INT((i16gBypassPressureSensorValue.Value - i16gBypassPressureSensorValue.AppScalingOffset) * i16gBypassPressureSensorValue.AppScalingDivisor / i16gBypassPressureSensorValue.AppScalingMultiplier);

IF u8gFuel.ToolScalingDivisor = 0 OR u8gFuel.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u8gFuelToolValue", "Division by Zero!");
	RETURN;
END_IF

u8gFuelToolValue := TO_USINT(((u8gFuel.Value - u8gFuel.AppScalingOffset) * u8gFuel.AppScalingDivisor / u8gFuel.AppScalingMultiplier * u8gFuel.ToolScalingMultiplier / u8gFuel.ToolScalingDivisor) + u8gFuel.ToolScalingOffset);

IF u16gBattery_Voltage.ToolScalingDivisor = 0 OR u16gBattery_Voltage.AppScalingMultiplier = 0 THEN
	_MatchLog^.Error("Get u16gBattery_VoltageToolValue", "Division by Zero!");
